import axios from "axios";
import DataTable from "react-data-table-component";
import Card from "@material-ui/core/Card";

const columns = [
    {
      name: "Nombre",
      selector: "name",
    },
    {
      name: "Categoria",
      selector: "category",
    },
    {
      name: "Unidades",
      selector: "unity",
      right: true
    }
  ];

export default function CallAPIView() {
    let response = axios.get("http://localhost:3001/getProducts");

    return (
        <div>
 <Card>
        <DataTable
          title="Movies"
          columns={columns}
          data={response}
          defaultSortField="title"
          pagination
          selectableRows
        />
      </Card>
        </div>
    );
}
